import React, { useState, useEffect } from 'react';
import Axios from 'axios';
const Dashboard=()=>{

    const [dash1, setDash1] = useState([]);

    useEffect(() => {
        Axios.get("http://localhost:9000/api/get/totalunit").then((Response) => {
          setDash1(Response.data)
        });
        Axios.get("http://localhost:9000/api/get/totalbuy").then((Response) => {
          setDash1(Response.data)
        });
        Axios.get("http://localhost:9000/api/get/totalsell").then((Response) => {
          setDash1(Response.data)
        });
        Axios.get("http://localhost:9000/api/get/total").then((Response) => {
          setDash1(Response.data)
        });
        console.log(setDash1);
      });
    return (
        <div className="container">
            <div>
                <h1>Dashboard</h1>
                <table>
                    <tr>
                        <td>Dashboard</td>
                    </tr>
                    <tr>
                        <td>Total units: {dash1.totalSum}</td>
                        <td>Total Investment: {dash1.totalBuy}</td>
                    </tr>
                    <tr>
                        <td>Sold Amount: {dash1.totalSell}</td>
                        <td>current Amount: {dash1.total - dash1.totalSell}</td>
                    </tr>
                    <tr>
                        <td>Over profit = {dash1,totalBuy - dash1.totalSell}</td>
                    </tr>
                </table>
            </div>
        </div>
    )
}
export default Dashboard;
